import React from "react";
import styled from "styled-components";

const Navbar = () => {
  return (
  <Wrap>
    <Logo>이름모하지</Logo>
    <Menus>
        <Menu>

        </Menu>
    </Menus>
  </Wrap>
  )
};

const Wrap = styled.div`
width: 80%;
height: 100px;
border: 1px solid #333;
position: fixed;
top: 5%;
display: flex;
flex-direction: row;
align-items: center;
`;

const Logo = styled.div``;

const Menus = styled.div`

`;

const Menu = styled.div``;

export default Navbar;
